import React, { Component } from 'react';
import experienceIcon from '../../assets/images/experience-icon.svg';
import locationIcon from '../../assets/images/location.svg';
import jobTypeIcon from '../../assets/images/job-type.svg';

// Style
import './styles.scss';

class ChangelogCards extends Component {
  render() {
    const {
      title,
      description,
      status,
      personImg,

      name,
      position,
    } = this.props;
    return (
      <div className='changelog-cards-style'>
        <div className='card-content'>
          <p className='heading'>{title}</p>

          <div className='status-time'>
            {status === 'New Feature' && (
              <p className='status new-feature'>New Feature</p>
            )}
            {status === 'Improvement' && (
              <p className='status new-feature'>Improvement</p>
            )}

            {status === 'Fix' && <p className='status new-feature'>Fix</p>}
          </div>

          <p className='description'>{description}</p>

          <div className='updated-info'>
            <img src={personImg} className='person-img' alt='person-img' />

            <div className='name-position'>
              <p className='name'>{name}</p>
              <p className='position'>{position}</p>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ChangelogCards;
